@StefanPatatu @Ukraine @bantg How exactly do you think the people of Ukraine will defend themselves?

I'm not attacking you. I'm just wondering how people rationalize it. They're being invaded. Right now. Civilians are being shot. 

I can't throw bread at them.

@ENS_DAO @BrantlyMillegan This snapshot includes everyone who delegates to me.

