Please let me know if you see any issues.

@m1guelpf @r_ross_campbell IPFS URIs are nicer as they can be built to end in /1 /2 /3, etc. 

I'm not aware of any project that outputs an Arweave URI from the tokenURI function for this reason.

https://t.co/C2wNHDo7X2 is used for permanent pinning, though I think it's based on good will from nodes atm.

@danbirken @sriramk Smartest is not the right word, I agree. Smart people do lots of things.

I think it's a combination of curious + poor/empathetic (at least one) + desire to make money.

Some people just cannot tolerate risk and therefore have no interest.

@danbirken @sriramk 1 in 6 Americans own crypto.

If the smartest people you know aren't familiar with web3, then they may be smart, but they're certainly not very curious.

It's 13-year old technology.

